import React from "react";

const Header = () => {
  return (
    <div className="ui fixed menu">
      <row>
      <div className="ui container left ">
      <h2>Program Hero</h2>

      </div>
      <div className="ui container right">
      <h2>Home</h2>
      <h2>About</h2>
      <h2>Blog</h2>

      </div>
      </row>
    </div>
  );
};

export default Header;
